char* iteadapter_generic_isPrecTrue(char* pReadPtr, uint32_t *result){
    uint32_t i, baseDist = 0, offsetDist = 0, r = 0;

    for (i=0; i < ITEADAPTER_GENERIC_NUMCHARS_PREC; ++i){
        if (*pReadPtr == iteadapter_generic_characters_prec[i]){break;}
    }
    baseDist = i;
    ++pReadPtr;
    for (i=0; i < ITEADAPTER_GENERIC_NUMCHARS_PREC; ++i){
        if (*pReadPtr == iteadapter_generic_characters_prec[i]){break;}
    }
    offsetDist = i;
    ++pReadPtr;

    if (baseDist == ITEADAPTER_GENERIC_NUMCHARS_PREC || offsetDist == ITEADAPTER_GENERIC_NUMCHARS_PREC){
    	printf("c ERROR. ITEADAPTER found an unknown symbol when reading the precondition ID.\n");
    	iteadapter_returnCode = ITEADAPTER_ERROR;
    	return pReadPtr;
    }

    uint32_t precID = baseDist*ITEADAPTER_GENERIC_NUMCHARS_PREC + offsetDist;

    switch(precID){
        case 0: r = param_adaptPrepStrategy; break;
        case 1: r = param_adaptPrepStrategyParams; break;
        case 2: r = param_adaptInpStrategy; break;
        case 3: r = param_adaptInpStrategyParams; break;
        case 4: r = param_adaptSearchStrategy; break;
        case 5: r = param_adaptSearchStrategyParams; break;
        case 6: r = param_adaptMpUR; break;
        case 7: r = param_adaptMpURParams; break;
        case 8: r = param_adaptSlsPAFVR; break;
        case 9: r = param_adaptSlsPAFVRParams; break;
        case 10: r = param_adaptSlsAIR; break;
        case 11: r = param_adaptSlsTRR; break;
        case 12: r = param_adaptSlsTRRParams; break;
        case 13: r = param_adaptCdclRR; break;
        case 14: r = param_adaptCdclRRParams; break;
        case 15: r = param_adaptCdclSVR; break;
        case 16: r = param_adaptCdclSVRParams; break;
        case 17: r = param_adaptCdclSVAI; break;
        case 18: r = param_adaptCdclSDR; break;
        case 19: r = param_adaptCdclSDRParams; break;
        case 20: r = param_adaptCdclSDDI; break;
        case 21: r = param_adaptCdclCAR; break;
        case 22: r = param_adaptCdclMR; break;
        case 23: r = param_adaptCdclMRParams; break;
        case 24: r = param_adaptCdclIR; break;
        case 25: r = param_adaptCdclIRParams; break;
        case 26: r = param_adaptCdclSLR; break;
        case 27: r = param_adaptCdclSOR; break;
        case 28: r = param_adaptCdclCBJLR; break;
        case 29: r = param_adaptCdclAR; break;
        default : iteadapter_returnCode = ITEADAPTER_ERROR; break;
    }

    if (iteadapter_returnCode != ITEADAPTER_UNKNOWN){
    	printf("c ERROR. ITEADAPTER tried to check a precondition with unknown ID.\n");
    	return pReadPtr;
    }

    *result = r;
    return pReadPtr;//Stays on '{' for the following block.
}

