char* iteadapter_generic_skipBlock(char *pReadPtr){
    while (*pReadPtr != '}'){
        if (*pReadPtr == '\0'){
            printf("c ERROR. ITEADAPTER skip-Block reached end of string. This cannot be.\n");
            iteadapter_returnCode = ITEADAPTER_ERROR;
            return pReadPtr;
        }
        if (*pReadPtr == '#'){
            printf("c ERROR. ITEADAPTER skip-Block reached end of guide-block. This cannot be.\n");
            iteadapter_returnCode = ITEADAPTER_ERROR;
            return pReadPtr;
        }
        ++pReadPtr;
    }
    ++pReadPtr;
    return pReadPtr; //Stays on symbol after '}'
}

void iteadapter_generic_adaptWithSet(char* pReadPtr){
	uint32_t isTrue = 0;
	while (*pReadPtr != '\0' && *pReadPtr != '#'){
		if (*pReadPtr > 64 && *pReadPtr < 91){
			pReadPtr = iteadapter_generic_isPrecTrue(pReadPtr, &isTrue);
			++pReadPtr;
			if (iteadapter_returnCode != ITEADAPTER_UNKNOWN){return;}
			if (!isTrue){
				pReadPtr = iteadapter_generic_skipBlock(pReadPtr);
				if (iteadapter_returnCode != ITEADAPTER_UNKNOWN){return;}
			} else {
				while (*pReadPtr != '}'){
					if (*pReadPtr == '\0'){
						printf("c ERROR. ITEADAPTER reached end of string in a parameter block. This cannot be.\n");
						iteadapter_returnCode = ITEADAPTER_ERROR;
						return;
					}
					if (*pReadPtr == '#'){
						printf("c ERROR. ITEADAPTER reached end of guide in a parameter block. This cannot be.\n");
						iteadapter_returnCode = ITEADAPTER_ERROR;
						return;
					}
					if (*pReadPtr > 96 && *pReadPtr < 123){
						pReadPtr = iteadapter_generic_setParam(pReadPtr);
						if (iteadapter_returnCode != ITEADAPTER_UNKNOWN){return;}
					} else {
						printf("c ERROR. ITEADAPTER found an unknown symbol in a parameter block. This cannot be.\n");
						iteadapter_returnCode = ITEADAPTER_ERROR;
						return;
					}
				}
				++pReadPtr;
			}
		}
	}
}

void iteadapter_intern_generic_adaptAll(){
	int32_t readID=0, success=0;
	char *paramString = NULL, *pReadPtr = NULL;

	#ifdef VERBOSE_ITEADAPTER
	printf("c     ITEADAPTER: Adapting for the current formula using GENERIC...\n");
	printf("c     ITEADAPTER: Checking CNF class %d(", MAIN_GET_FATT_CLASS());
	tools_cnfClasses_printClassName(MAIN_GET_FATT_CLASS());
	printf(")\n");
	#endif
	if (MAIN_GET_FATT_CLASS() <= CNFCLASSES_CLASS_MINNUM || MAIN_GET_FATT_CLASS() >= CNFCLASSES_CLASS_MAXNUM){
		printf("c     ITEADAPTER:   Impossible. CNF class is not recognized.\n");
		printf("c     ITEADAPTER:   No adaptation is performed.\n");
		return;
	}

	#ifdef VERBOSE_ITEADAPTER
	printf("c     ITEADAPTER: Checking guide %d (", param_guide);
	guidance_extern_printNameOfGuide(param_guide);
	printf(")\n");
	#endif
	if (param_guide != GUIDE_AUTOADAPT && !guidance_extern_isGuideAdaptable(param_guide)){
		#ifdef VERBOSE_ITEADAPTER
		printf("c     ITEADAPTER:   Impossible. Not an adaptable guide.\n");
		printf("c     ITEADAPTER:   No adaptation is performed.\n");
		#endif
		return;
	}

	#ifdef VERBOSE_ITEADAPTER
	printf("c     ITEADAPTER: Checking if a valid parameter setting for the CNF class is available...\n");
	#endif

	paramString = iteadapter_generic_paramsForClasses[MAIN_GET_FATT_CLASS() - CNFCLASSES_CLASS_MINNUM];
	if (paramString == NULL){
		#ifdef VERBOSE_ITEADAPTER
		printf("c     ITEADAPTER:   There is no parameter setting available for this class.\n");
		printf("c     ITEADAPTER:   No adaptation is performed.\n");
		#endif
		return;
	}

	#ifdef VERBOSE_ITEADAPTER
	printf("c     ITEADAPTER:   A parameter setting for the CNF class is available.\n");
	#endif
	if (param_guide == GUIDE_AUTOADAPT){
		#ifdef VERBOSE_ITEADAPTER
		printf("c     ITEADAPTER:   The guide is AUTOADAPT, picking first parameter set.\n");
		#endif
		pReadPtr = paramString;
		while (*pReadPtr != '\0'){
			if (*pReadPtr == '#'){
				success = sscanf(pReadPtr, "#%d#", &readID);
				if (!success){
					printf("c ERROR. ITEADAPTER failed to read a guide ID from a parameter setting string.\n");
					iteadapter_returnCode = ITEADAPTER_ERROR;
					return;
				}
				if (readID < GUIDE_MINVALUE || readID > GUIDE_MAXVALUE){
					printf("c ERROR. ITEADAPTER read a guide ID from a parameter string that does not exist.\n");
					iteadapter_returnCode = ITEADAPTER_ERROR;
					return;
				}
				++pReadPtr;
				while (*pReadPtr != '#') ++pReadPtr;
				++pReadPtr;
				break;
			} else {
			  ++pReadPtr;
			}
		}
	} else {
		#ifdef VERBOSE_ITEADAPTER
		printf("c     ITEADAPTER:   Checking, if a parameter set for the CNF class and current guide exists...\n");
		#endif
		pReadPtr = paramString;
		while (*pReadPtr != '\0'){
			if (*pReadPtr == '#'){
				success = sscanf(pReadPtr, "#%d#", &readID);
				if (!success){
					printf("c ERROR. ITEADAPTER failed to read a guide ID from a parameter setting string.\n");
					iteadapter_returnCode = ITEADAPTER_ERROR;
					return;
				}
				if (readID < GUIDE_MINVALUE || readID > GUIDE_MAXVALUE){
					printf("c ERROR. ITEADAPTER read a guide ID from a parameter string that does not exist.\n");
					iteadapter_returnCode = ITEADAPTER_ERROR;
					return;
				}
				++pReadPtr;
				while (*pReadPtr != '#') ++pReadPtr;
				++pReadPtr;
				if (readID == param_guide) break;
			} else {
			  ++pReadPtr;
			}
		}
		if (*pReadPtr == '\0'){
			#ifdef VERBOSE_ITEADAPTER
			printf("c     ITEADAPTER:     No parameter set for the selected guide exists for the given CNF class.\n");
			printf("c     ITEADAPTER:     No adaptation is performed.\n");
			#endif
			return;
		}
	}
	
	param_guide = readID;
	#ifdef VERBOSE_ITEADAPTER
	printf("c     ITEADAPTER:     A parameter set for the current guide and the given CNF class exists (offset %d)!\n",
			(int32_t) (pReadPtr - paramString));
	printf("c     ITEADAPTER:     Adaptation is performed, the guide will be %d (", param_guide);
	guidance_extern_printNameOfGuide(param_guide);
	printf(")\n");
	#endif

	iteadapter_generic_adaptWithSet(pReadPtr);
	if (iteadapter_returnCode != ITEADAPTER_UNKNOWN){
		printf("c ERROR. ITEADAPTER was unable to adapt.\n");
	}
}
